import React from "react";
import Link from "next/link";

const Page = () => (
  <div>
    <h1>Note Index Page</h1>
    <Link href='/notes/[id]' as={`/notes/1`}>
      <a>Link to Note 1</a>
    </Link>
  </div>
);

export default Page;
